import React from 'react';
import Header from 'Header';
import Products from 'Products';

import 'css/app.scss';
import 'css/style.scss';

class App extends React.Component {

  render() {
    return (
      <div className="main">
        <Header />
        <Products />
        <p>App Component</p>
      </div>
    );
  }
} 

export default App
